<script>
	$(document).ready(function() {
	  $('.cn-button').addClass('animated bounce');
	});
	$('.cn-button').click(function(){
		$('.cn-overlay').addClass('show');
		$('.cn-wrapper').addClass('opened-nav');
		$('.cn-wrapper').attr('style', 'top: ' + event.pageY + 'px; left: ' + event.pageX + 'px;');
	});
	$('.cn-overlay').click(function(){
		$('.cn-overlay').removeClass('show');
		$('.cn-wrapper').removeClass('opened-nav');
		$('.sub1').removeClass('opened-nav');
		$('.sub2').removeClass('opened-nav');
		$('.sub3').removeClass('opened-nav');
		$('.sub4').removeClass('opened-nav');

	});
	$('.cn-wrapper .one').mouseover(function(){
		$('.sub1').addClass('opened-nav');
		$('.sub1').attr('style', 'top: ' + ($('.cn-wrapper').position().top-215) + 'px; left: ' + ($('.cn-wrapper').position().left-215) + 'px;');
	});

	$('.cn-wrapper .two').mouseover(function(){
		$('.sub2').addClass('opened-nav');
		$('.sub2').attr('style', 'top: ' + ($('.cn-wrapper').position().top-215) + 'px; left: ' + ($('.cn-wrapper').position().left-215) + 'px;');
	});

	$('.cn-wrapper .three').mouseover(function(){
		$('.sub3').addClass('opened-nav');
		$('.sub3').attr('style', 'top: ' + ($('.cn-wrapper').position().top-215) + 'px; left: ' + ($('.cn-wrapper').position().left-215) + 'px;');
	});

	$('.cn-wrapper .four').mouseover(function(){
		$('.sub4').addClass('opened-nav');
		$('.sub4').attr('style', 'top: ' + ($('.cn-wrapper').position().top-215) + 'px; left: ' + ($('.cn-wrapper').position().left-215) + 'px;');
	});

	$('.cn-wrapper-sub').mouseout(function(){
		$('.sub1').removeClass('opened-nav');
		$('.sub2').removeClass('opened-nav');
		$('.sub3').removeClass('opened-nav');
		$('.sub4').removeClass('opened-nav');
	});

</script>
